#!/usr/bin/env python3

import sys

if __name__ == '__main__':
    s = sys.stdin.readline().strip()
    print(len(s) - len(set(s)))

def sum_of_digits(n):
    sum = 0
    while n > 0:
        sum += n % 10
        n = n // 10
    return sum


def main():
    n = int(input())
    if sum_of_digits(n // 1000) == sum_of_digits(n % 1000):
        print(0)
    else:
        print(1)


if __name__ == '__main__':
    main()

